import React from 'react';
import './Card.css';
import posed, {PoseGroup} from 'react-pose';

const pop = posed.div({
    enter: { staggerChildren: 50 },
    exit: { staggerChildren: 20, staggerDirection: -1 }
});

const Card = ({children}) =>{
    return(
        <div className="outerCard">
            {children}
        </div>
    )
}

export default Card;
